class NewWindow(QtWidgets.QMainWindow):
        def __init__(self):
            super().__init__()
            self.setWindowTitle('控制台输出')
            self.setGeometry(1300, 600, 400, 300)
            layout = QVBoxLayout()
            self.console = QtWidgets.QTextBrowser(self)
            self.console.setGeometry(10, 10, 380, 280)
            layout.addWidget(self.console)
            self.setWindowFlags(QtCore.Qt.WindowStaysOnTopHint)
            icon = QIcon()
            icon.addPixmap(QtGui.QPixmap.fromImage(QtGui.QImage.fromData(base64.b64decode(icons.icon1))))
            self.setWindowIcon(icon)
            central_widget = QtWidgets.QWidget()
            central_widget.setLayout(layout)
            self.setCentralWidget(central_widget)

            # 重定向标准输出和标准错误到 console
            sys.stdout = ConsoleRedirect(self.console, sys.stdout)
            sys.stderr = ConsoleRedirect(self.console, sys.stderr)
            font = QtGui.QFont()
            font.setFamily("微软雅黑")
            font.setPointSize(15)
            font.setBold(True)

class ConsoleRedirect:
        def __init__(self, console, stream):
            # pass
            self.console = console
            self.stream = stream

        def write(self, text):
            # pass
            # 将文本写入到 console
            self.console.insertPlainText(text)

        def flush(self):
            # 刷新 console
            pass